import React from "react";
import ReactDOM from "react-dom";
import "./index.css";
import "materialize-css/dist/css/materialize.min.css";
// ========================================
import M from "materialize-css";

class LoginNav extends React.Component {
  componentDidMount() {
    // Auto initialize all the things!
    M.AutoInit();
  }

  render() {
    return (
      <nav>
        <div classNameName="nav-wrapper black">
          <a href="#" classNameName="brand-logo">
            The SCARS Project
          </a>
          <ul id="nav-mobile" classNameName="right hide-on-med-and-down">
            <li>
              <a classNameName="waves-effect waves-light btn green" href="#">
                Sign-Up
              </a>
            </li>
          </ul>
        </div>
      </nav>
    );
  }
}
class WelcomeNav extends React.Component {
  componentDidMount() {
    // Auto initialize all the things!
    M.AutoInit();
  }

  render() {
    return (
      <nav>
        <div classNameName="nav-wrapper black">
          <a href="#" classNameName="brand-logo">
            The SCARS Project
          </a>
          <ul id="nav-mobile" classNameName="right hide-on-med-and-down">
            <li>
              <a classNameName="waves-effect waves-light btn green" href="#">
                Sign-In
              </a>
              <a classNameName="waves-effect waves-light btn green" href="#">
                Sign-In
              </a>
              <a classNameName="waves-effect waves-light btn green" href="#">
                Sign-In
              </a>
            </li>
          </ul>
        </div>
      </nav>
    );
  }
}
class LoginForm extends React.Component {
  componentDidMount() {
    // Auto initialize all the things!
    M.AutoInit();
  }
  render() {
    return (
      <>
        <div className="row">
          <div className="input-field col s12">
            <input
              className="validate"
              type="text"
              name="username"
              id="email"
              required
            />
            <label for="email">Username</label>
          </div>
        </div>
        <div className="row">
          <div className="input-field col m12">
            <input
              className="validate"
              type="password"
              name="password"
              id="password"
              required
            />
            <label for="password">Password</label>
          </div>
          <label style="float: right;">
            <a>
              <b style="color: #F5F5F5;">Forgot Password?</b>
            </a>
          </label>
        </div>
        <br />
        <center>
          <div className="row">
            <button
              style="margin-left:65px;"
              type="submit"
              name="btn_login"
              className="col  s6 btn btn-small white black-text  waves-effect z-depth-1 y-depth-1"
            >
              Login
            </button>
          </div>
        </center>
      </>
    );
  }
}

ReactDOM.render(<LoginNav />, document.getElementById("root"));
